import '../styles/Login.css';
import useForm from '../hooks/useForm';
import { useState } from 'react';

const Login = () => {

    const { login, pass, onChange } = useForm({
        login: '',
        pass: '',
        error: '',
    });

    const [error, setError] = useState<string>('')

    const ingresar = (e: any) => {

        e.preventDefault();
        if(login === 'prueba' && pass === 'prueba'){
            setError('')
        }
        else{
            setError('Usuario o clave invalida');
        }
    }

    return (
        <div className="container form-login">
            <form>
                <div className="form-group">
                    <label htmlFor="usuario">Usuario</label>
                    <input type="text" className="form-control" onChange={(e) => onChange(e.target.value, 'login')} value={login} id="usuario" aria-describedby="emailHelp" placeholder="Usuario" />
                </div>
                <div className="form-group">
                    <label htmlFor="password">Clave</label>
                    <input type="password" className="form-control" onChange={(e) => onChange(e.target.value, 'pass')} value={pass} id="password" placeholder="Clave" />
                </div>
                {
                    error && <div className='error'>{error}</div>
                }
                <div className='login'>
                    <br></br>
                    <button onClick={ingresar} className="btn btn-primary">Login</button>
                </div>
            </form>
        </div>
    )
}

export default Login;
